    // document.getElementById("demo").innerHTML = obj
    // const out = document.getElementById("demo").innerHTML = data;
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
            usd -
          {
            !usd ? "Loading..." : usd
          }
        </p>
        <p>
            eur -
          {
            !eur ? "Loading..." : eur
          }
        </p>
        <p> jpy -
          {
            !jpy ? "Loading..." : jpy
          }
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
